import React from 'react'
import { Navigate } from 'react-router-dom'

const protectedRoute = ({children}) => {
  let authentication = true
  if(!authe){
    return <Navigate to="/" />;
  }
  return (
    <div>protectedRoutes</div>
  )
}

export default protectedRoute;
